        border: '1px solid #5A2120',
        width:'130px',
        height:'130px',
        color:'#5A2120',
        fontSize:'12px',
        fontFamily: 'Rubik, sans-serif',
        padding:'5px'
    }

}));

const Election = () => {
  const classes = useStyles();
  return (
    
      <button className={classes.election}>
          ELECCIONES RECTORALES 2021
      </button>
    
  );
}

export default Election;
